package loopassignment;

public class CubeBt1to5 {
      void display()
      {
    	  for(int i=1;i<=5;i++)
    	  {
    		  System.out.println(i*i*i);
    	  }
      }
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		CubeBt1to5 Cu=new CubeBt1to5();
		Cu.display();
	}

}
